import React from "react";
import Graphic from "../graphic/graphic";

const Home = () => {
  const gaz_data = [
    { data: new Date(2020, 5, 1), value: 10 },
    { data: new Date(2020, 5, 2), value: 13 },
    //{ data: new Date(2020, 5, 3), value: 6 },
    // { data: new Date(2020, 5, 4), value: 10 },
    // { data: new Date(2020, 5, 5), value: 1 },
    // { data: new Date(2020, 5, 6), value: 20 },
  ];
  const apa_data = [
    { data: new Date(2020, 5, 1), value: 9 },
    { data: new Date(2020, 5, 2), value: 3 },
    { data: new Date(2020, 5, 3), value: 16 },
    { data: new Date(2020, 5, 4), value: 10 },
    { data: new Date(2020, 5, 5), value: 7 },
    { data: new Date(2020, 5, 6), value: 11 },
  ];
  const new_data = [
    { data: new Date(2020, 5, 4), value: 10 },
    { data: new Date(2020, 5, 5), value: 7 },
    { data: new Date(2020, 5, 6), value: 11 },
  ];
  return (
    <div>
      <Graphic
        title={"gaz"}
        data={gaz_data}
        color={"rgba(220,20,60,0.5)"}
        lastMonth={apa_data}
      />
      <Graphic
        title={"apa"}
        data={apa_data}
        color={"rgba(30,144,255,0.5)"}
        lastMonth={gaz_data}
      />
      <Graphic
        title={"apa"}
        data={new_data}
        color={"rgba(30,144,255,0.5)"}
        lastMonth={apa_data}
      />
    </div>
  );
};

export default Home;
